import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
//import Landing from './components/pages/Landing'
import Navbar from './components/Navbar';

function App() {
  return (

    <Router>
      <Routes>
        <Route path="/">
          <Navbar/>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
